how i use my @amika thermal brush✨
i’ve been playing with this brush a couple times now and i think i’m finally getting the hang of it! it took me a while because i kept expecting it to work as a blow dry brush rather than a curling iron brush lol but i love how shiny it leaves my hair and how quick i can style it!
