 @suavecitapomade argan oil (use code _heartwork_)
@olaplex number 6 leave in
@keracolorhair blowout cream
@kenraprofessional thermal styling spray

@wavytalkofficial hooked me up w/ a blow dryer 🤍✨
i love how light it is and it also came with three different attachments so the hairstyle possibilities are endlesss.
